  if(sp_missing && sp_missing.length > 0) {
    email_message += "<h4>Story Points Missing</h4>";
  	sp_missing.forEach(function(entry) {
        var base_url = "https://dev.azure.com/eysbp/eysbp/CTP - Core Platform/_workitems/edit/";
    	email_message+= "<p><a href='"+ base_url+entry.workitem_id +"'>"+ entry.workitem_id +"</a> "+ entry.summary +" </p>";

